import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';

@Component({
  selector: 'app-mainpage',
  templateUrl: './mainpage.component.html',
  styleUrls: ['./mainpage.component.css']
})
export class MainpageComponent implements OnInit {
  formGroup: FormGroup;

  constructor(private fb: FormBuilder) {
    this.formGroup = this.fb.group({
      name: ['', [Validators.required, Validators.minLength(3)]],
      surname: ['', [Validators.required, Validators.minLength(3)]],
      idNumber: ['', [Validators.required, Validators.pattern('^[0-9]{9,15}$')]],
      phoneNumber: ['', [Validators.required, Validators.pattern('^[0-9]{10,15}$')]],
      title: ['', Validators.required],
      issuePlace: ['', Validators.required],
      issueDate: ['', Validators.required],
      expirationDate: ['', Validators.required],
      paymentMethod: ['', Validators.required],
      remarks: ['']
    });
  }

  ngOnInit(): void {}

  onSubmit(): void {
    if (this.formGroup.valid) {
      console.log('Form submitted:', this.formGroup.value);
      // Perform further actions (e.g., send data to a backend service)
    } else {
      console.log('Form is invalid. Please check the fields.');
    }
  }
}
<!DOCTYPE html>
<html lang="ar" dir="rtl">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>نموذج إدخال</title>
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.rtl.min.css">
    <style>
        /* Base layout styling */
        body {
            margin: 0;
            padding: 0;
            background: linear-gradient(180deg, rgba(255, 255, 255, 0.8) 0%, rgba(240, 240, 240, 0.6) 100%);
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: flex-start;
        }

        .container {
            background: rgba(255, 255, 255, 0.9);
            border-radius: 15px;
            box-shadow: 0 10px 20px rgba(0, 0, 0, 0.15);
            padding: 20px 40px;
            width: 100%;
            max-width: 700px;
            height: 50vh; /* Restrict the form to the top half of the page */
            overflow-y: auto; /* Allow scrolling if content overflows */
        }

        h2 {
            font-size: 1.5rem;
            color: #333;
            text-align: center;
            margin-bottom: 20px;
        }

        label {
            font-weight: 500;
            font-size: 0.9rem;
        }

        .form-control, .form-select {
            border-radius: 8px;
            box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.1);
        }

        button {
            padding: 10px 20px;
            border-radius: 8px;
        }

        .btn-primary {
            background: linear-gradient(90deg, #007bff 0%, #0056b3 100%);
            border: none;
        }

        .btn-primary:hover {
            background: linear-gradient(90deg, #0056b3 0%, #003d99 100%);
        }

        .btn-secondary {
            background: #6c757d;
            border: none;
        }

        .btn-secondary:hover {
            background: #5a6268;
        }

        @media (max-width: 768px) {
            .container {
                padding: 15px 20px;
            }

            button {
                font-size: 0.9rem;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <h2>نموذج إدخال</h2>
        <form [formGroup]="formGroup" (ngSubmit)="onSubmit()">
            <div class="row">
                <div class="col-md-6 mb-3">
                    <label for="name" class="form-label">الاسم</label>
                    <input type="text" class="form-control" id="name" formControlName="name" placeholder="ادخل الاسم">
                </div>
                <div class="col-md-6 mb-3">
                    <label for="surname" class="form-label">اللقب</label>
                    <input type="text" class="form-control" id="surname" formControlName="surname" placeholder="ادخل اللقب">
                </div>
            </div>

            <div class="row">
                <div class="col-md-6 mb-3">
                    <label for="idNumber" class="form-label">الرقم الوطني</label>
                    <input type="text" class="form-control" id="idNumber" formControlName="idNumber" placeholder="ادخل الرقم الوطني">
                </div>
                <div class="col-md-6 mb-3">
                    <label for="phoneNumber" class="form-label">رقم الهاتف</label>
                    <input type="text" class="form-control" id="phoneNumber" formControlName="phoneNumber" placeholder="ادخل رقم الهاتف">
                </div>
            </div>

            <div class="row">
                <div class="col-md-6 mb-3">
                    <label for="title" class="form-label">العنوان</label>
                    <input type="text" class="form-control" id="title" formControlName="title" placeholder="ادخل العنوان">
                </div>
                <div class="col-md-6 mb-3">
                    <label for="issuePlace" class="form-label">مكان الإصدار</label>
                    <input type="text" class="form-control" id="issuePlace" formControlName="issuePlace" placeholder="ادخل مكان الإصدار">
                </div>
            </div>

            <div class="row">
                <div class="col-md-6 mb-3">
                    <label for="issueDate" class="form-label">تاريخ الإصدار</label>
                    <input type="date" class="form-control" id="issueDate" formControlName="issueDate">
                </div>
                <div class="col-md-6 mb-3">
                    <label for="expirationDate" class="form-label">تاريخ الانتهاء</label>
                    <input type="date" class="form-control" id="expirationDate" formControlName="expirationDate">
                </div>
            </div>

            <div class="row">
                <div class="col-md-6 mb-3">
                    <label for="paymentMethod" class="form-label">كيفية الدفع</label>
                    <select class="form-select" id="paymentMethod" formControlName="paymentMethod">
                        <option value="">اختر كيفية الدفع</option>
                        <option value="نقدا">نقدا</option>
                        <option value="صك بنكي">صك بنكي</option>
                        <option value="حوالة بريدية">حوالة بريدية</option>
                        <option value="صك بريدي">صك بريدي</option>
                        <option value="دفع إلكتروني">دفع إلكتروني</option>
                        <option value="مجانا">مجانا</option>
                    </select>
                </div>
                <div class="col-md-6 mb-3">
                    <label for="remarks" class="form-label">ملاحظات</label>
                    <textarea class="form-control" id="remarks" formControlName="remarks" rows="3" placeholder="ادخل الملاحظات"></textarea>
                </div>
            </div>

            <div class="text-center">
                <button type="submit" class="btn btn-primary">حفظ</button>
                <button type="reset" class="btn btn-secondary">إعادة تعيين</button>
            </div>
        </form>
    </div>
</body>
</html>
